import './About.css';

const About = () => {
    return (
        <section className='about' id="ab">
            <h2>
                Sobre
            </h2>
            <p>
                <strong>Saudações Capiravas, Capivaros e Capivares!</strong> Nós somos a Sociedade Capirremoto, um grupo de amigos apaixonados pela arte de rolar dadinhos e combar fichas... Opa, digo, apaixonados pelo RPG! Nosso canal possui um foco em sistemas de Terror, Investigação, Mistério e Horror Pessoal, mas a gente tá sempre se aventurando por diversos outros mundos, sejam em reinos medievais fantásticos, em mundos mágicos debaixo da cama ou em galáxias muito, muito distantes. Contamos histórias horripilantes, emocionantes e cativantes, buscando o divertimento não só de nossos amigos, parceiros e apoiadores que jogam conosco, mas também de nossos espectadores que acompanham cada momento de nossas Crônicas e Aventuras avidamente toda semana. Somos apaixonados me criar um ambiente seguro e inclusivo em nossas mesas e comunidades, além de tentarmos sempre dar um brilho especial para a rica e bela cultura do nosso povo.
            </p>
        </section>
    );
}

export default About;
